div.div:
Последний вид цикла - ranged for loop. В отличии от всех предыдущих циклов, он не проверяет условное выражение, а вместо этого действует итеративно, проходя каждый элемент контейнера (массива или других гомогенных коллекций).
Такой вид цикла прежде всего предназначен для работа с итераторами классов-контейнеров из стандартной библиотеки. Но также он работает со статическими (но не динамическими!) массивами, размер которых известен на стадии компиляции (включая строковые литералы).
В отличии от других циклов, ranged for loop не может быть бесконечным.
Ex. int arr[] = {0, 1, 2, 3, 4, 5};
for (int element : arr) {
std::cout << element << ' ';
}
std::cout << std::endl; // выведет все элементы массива
// от 1 до 5
Ex. char* str = "string";
for (int element : str) {
std::cout << element;
}
std::cout << std::endl; // выведет строку целиком
